public class InnerCertificateAuthorityRevocationConfigurationFactory(Action<Humidifier.ACMPCA.CertificateAuthorityTypes.RevocationConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.ACMPCA.CertificateAuthorityTypes.RevocationConfiguration>
{

    internal InnerCertificateAuthorityOcspConfigurationFactory OcspConfigurationFactory { get; set; }

    internal InnerCertificateAuthorityCrlConfigurationFactory CrlConfigurationFactory { get; set; }

    protected override Humidifier.ACMPCA.CertificateAuthorityTypes.RevocationConfiguration Create()
    {
        var revocationConfigurationResult = CreateRevocationConfiguration();
        factoryAction?.Invoke(revocationConfigurationResult);

        return revocationConfigurationResult;
    }

    private Humidifier.ACMPCA.CertificateAuthorityTypes.RevocationConfiguration CreateRevocationConfiguration()
    {
        var revocationConfigurationResult = new Humidifier.ACMPCA.CertificateAuthorityTypes.RevocationConfiguration();

        return revocationConfigurationResult;
    }
    public override void CreateChildren(Humidifier.ACMPCA.CertificateAuthorityTypes.RevocationConfiguration result)
    {
        base.CreateChildren(result);

        result.OcspConfiguration ??= OcspConfigurationFactory?.Build();
        result.CrlConfiguration ??= CrlConfigurationFactory?.Build();
    }

} // End Of Class

